DROP TABLE IF EXISTS `ts_org_postion_k`;

CREATE TABLE `ts_org_postion_k` (
  `POSTION_ID` varchar(40) NOT NULL COMMENT '岗位Id（UUID）',
  `POSTION_TYPE` varchar(40) DEFAULT NULL COMMENT '岗位类code',
  `POSTION_SEQUENCE` varchar(40) DEFAULT NULL COMMENT '岗位序列',
  `POSTION_NAME` text NOT NULL COMMENT '岗位名称',
  `POSTION_QUALIFICATION` varchar(40) DEFAULT NULL COMMENT '岗位资格',
  `S_USER` varchar(40) DEFAULT NULL COMMENT '添加者',
  `S_TDEPT` varchar(40) DEFAULT NULL COMMENT '当前有效部门编码',
  `S_ODEPT` varchar(40) DEFAULT NULL COMMENT '当前机构编码',
  `S_MTIME` varchar(40) DEFAULT NULL COMMENT '更新时间',
  `S_FLAG` decimal(4,0) DEFAULT NULL COMMENT '启用标志，1：是；2：否',
  `S_DEPT` varchar(40) DEFAULT NULL COMMENT '当前部门编码',
  `S_CMPY` varchar(40) DEFAULT NULL COMMENT '当前公司编码',
  `S_ATIME` varchar(40) DEFAULT NULL COMMENT '添加时间',
  `POSTION_TYPE_NAME` varchar(40) DEFAULT NULL COMMENT '岗位类名称',
  `POSTION_SEQUENCE_ID` varchar(40) DEFAULT NULL COMMENT '岗位序列ID',
  `POSTION_NAME_CODE` varchar(40) DEFAULT NULL COMMENT '职务层级CODE',
  `postion_pid` varchar(400) DEFAULT NULL,
  `code_path` varchar(400) NOT NULL,
  `postion_level` varchar(40) NOT NULL,
  `postion_idvalue` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`POSTION_ID`),
  UNIQUE KEY `SYS_C009914` (`POSTION_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='岗位表';


